import React from 'react';
import HeroSection from '../components/HeroSection';
import ContactForm from '../components/ContactForm';
import { Container, Typography, Box } from '@mui/material';

const Home = () => {
  return (
    <>
      <HeroSection />
      <Container sx={{ py: 5 }}>
        <Typography variant="h4" gutterBottom>
          About Hono Technology
        </Typography>
        <Typography variant="body1" paragraph>
          Hono Technology is a leader in Information Technology & Services, delivering innovative solutions to empower businesses and individuals. In partnership with Zvertex AI, we provide cutting-edge tools to help you excel in the job market and secure your dream career.
        </Typography>
        <Box sx={{ mt: 5 }}>
          <Typography variant="h4" gutterBottom>
            Our Services
          </Typography>
          <Typography variant="body1">
            - Career-enhancing AI tools via Zvertex AI<br />
            - Custom IT solutions<br />
            - Professional consulting services
          </Typography>
        </Box>
      </Container>
      <ContactForm />
    </>
  );
};

export default Home;
